import {FETCH_TOP_PLAYERS,FETCH_LATEST_PLAYERS} from './actionType'
import axios from 'axios'

const token = localStorage.getItem("userToken");

export const fetchTopPlayer = () => dispatch => {
    axios.get('http://localhost:8080/api/public/v1/players/top?region=')
        .then(res =>
            dispatch({
                type: FETCH_TOP_PLAYERS,
                payload: res.data
            })
        );
};
export const fetchLatestPlayers = () => dispatch => {
    axios.get('http://localhost:8080/api/public/v1/players/latest',{headers: {"Bearer": token }})
        .then(res => 
            dispatch({
                type: FETCH_LATEST_PLAYERS,
                payload: res.data
            }),
        );
};
